import React from "react";

const ParamCompo = () => {
  return (
    <div className="ParamCompo">
      <h4>ParamCompo</h4>
      <p>
        이름 :{query.name} <br />
        나이 :{query.age} <br />
        주소 :{query.addr} <br />
      </p>
    </div>
  );
};

export default ParamCompo;
